import React from "react";

const Skills = () => {
  return (
    <div className="row justify-content-center">
      <div className="col-md-6 skillcol">
        <h3>Full Stack Developer</h3>
        <ul className="skilllist">
          <li>React</li>
          <li>Node.js</li>
          <li>Express</li>
          <li>MongoDB</li>
          <li>GraphQL</li>
          <li>Bootstrap</li>
          <li>Blender</li>
          <li>Git</li>
          <li>VSCode</li>
        </ul>
      </div>
    </div>
  );
};

export default Skills;
